summary.label:
O App Meets CRM oferece acesso às informações integradas aos usuários da sua conta na web. O Meets oferece pra você uma sistema online onde você poderá controlar o relacionamento com seus clientes e centralizar os atendimento da sua equipe de venda.

Com ele você poderá:
- Gerenciar eventos (calendário com os próximos compromissos);
- Gerenciar contatos (cadastro segmentado de clientes, empresas, pessoas, etc.);
- Gerenciar Oportunidades (leads, novos negócios e prospecções com valores e produtos);
- Gerenciar Atendimentos (salve todas as conversas e contatos estabelecidos com os clientes e tenha um histórico);
- Gerenciar Atividades (crie atividades/tarefas e acompanhe os passos para um objetivo real);
- Notificações (receba notificações da sua agenda e atividades e nunca mais esqueça de ligar para seu cliente).
